import ExpenseItem from './Components/ExpenseItem'


function App(){
    let expenseDate = new Date(2023,1,7);
    let expenseTitle = "School Fee";
    let expenseAmount = 300;
    return(
        <div>
            <h1>Let's Start</h1>
            <ExpenseItem
                todaysDate = {expenseDate}
                title = {expenseTitle}
                amount = {expenseAmount}>
            </ExpenseItem>
        </div>
    );
}

export default App;
